import express from 'express';
import morgan from 'morgan';
import cors from 'cors';
import path from 'path';

//conexion a base de datos 
//import mongoose from './db/db.js'; //ruta al archivo
//para poder conectarme a base de datos, creo por fuera 
import connectToDatabase from './db/db.js';



const app = express();

// Middleware
app.use(morgan('tiny'));
app.use(cors());
app.use(express.json());
app.use(express.urlencoded({ extended: true }));

app.use('/api',require('./routes/cita.js'));
// app.use(express.static(path.join(__dirname, 'public')));

// Rutas
app.get('/', (req, res) => {
  res.send('<h1>En funcionanmiento...</h1>');
});

// Middleware para Vue.js router modo history
const history = require('connect-history-api-fallback');
app.use(history());
app.use(express.static(path.join(__dirname, 'public')));

app.set('puerto', process.env.PORT || 3000);


setTimeout(() => {
  app.listen(app.get('puerto'), () => {
    console.log('Example app listening on port: '+ app.get('puerto') + ' y tambien esta tu hermana');
  });
}, 1000);

connectToDatabase();


